                        proizvoda bio je da li će raditi <b id="if6iyj">pored jezera na kampovanju</b> gde inače najviše ima komaraca. Moja braća i ja smo jedan vikend otišli na Srebrno jezero,
                        tamo je inače prelepo ali su problem rojevi komaraca od kojih ne može da se živi (moja supruga nije htela da rizikuje i povede ćerku).
                        U sumrak, kada ima najviše komaraca, uzeo sam ga  i postavio ga pored šatora. <b id="i2w6bq">Nakon 5 minuta, gle čuda, oko nas ni jednog komarca nije bilo,</b> ali je
